import React, { Component } from 'react';
import './App.css';
import Customers from './components/customers';
import { Row, Col, Container, Button } from 'reactstrap';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Container>
           <Row>
            <Col>.col</Col>
            <Col>.col</Col>
            <Col>.col</Col>
            <Col>.col</Col>
          </Row>
        </Container>
        <Customers />
      </div>
    );
  }
}

export default App;
